webpackJsonp([0x771168e3fd71],{533:function(t,e){t.exports={data:{wordpressPost:{title:"Hospital admissions, podcasts and rural vaccinations: Most read articles in August",content:'<p>The most-read article in August was Hornshøj <em>et al</em>&#8216;s article on vaccination coverage in rural Guinea-Bissau. Carter <em>et al</em>&#8216;s interview study of workplace bullying in the NHS stayed in the top ten for another month. Another title was the subject of the first <a href="https://soundcloud.com/bmjpodcasts/how-active-are-our-children?in=bmjpodcasts/sets/bmj-open-podcast" target="_blank">BMJ Open podcast</a>: Griffiths <em>et al</em> on how active our children are.  Other newly-published papers in the top ten include Aveling <em>et al</em>&#8216;s quality study comparing surgical safety checklists in high-income and low-income countries and Billings e<em>t al</em>&#8216;s observational study on hospital admissions.</p>\n<table width="483" border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Hornshøj <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/6/e001509.full" target="_blank">Vaccination coverage and out-of-sequence vaccinations in rural Guinea-Bissau: an observational cohort study</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Carpenter <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/5/e002299.full" target="_blank">Bed sharing when parents do not smoke: is there a risk of SIDS? An individual level analysis of five major case–control studies</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Griffiths <em>et al</em></td>\n<td valign="top" width="301"><a href="http://www.bmjopen.bmj.com/content/3/8/e002893" target="_blank">How active are our children? Findings from the Millennium Cohort Study</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Gao <em>et al</em></td>\n<td valign="top" width="301"><a href="http://www.bmjopen.bmj.com/content/3/7/e002881.full" target="_blank">Effects of centrally acting ACE inhibitors on the rate of cognitive decline in dementia</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Kerns<em> et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/7/e002931.full" target="_blank">How patients want to engage with their personal health record: a qualitative study</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Aveling<em> et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/8/e003039.abstract" target="_blank">A qualitative study comparing experiences of the surgical safety checklist in hospitals in high-income and low-income countries</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Wallace <em>et al</em></td>\n<td valign="top" width="301"><a href="http://www.bmjopen.bmj.com/content/3/7/e002929" target="_blank">The epidemiology of malpractice claims in primary care: a systematic review</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Wakefield <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/7/e003175.full" target="_blank">Introduction effects of the Australian plain packaging policy on adult smokers: a cross-sectional study</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Ford <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/3/e002269.short" target="_blank">Current treatments in diabetic macular oedema: systematic review and meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Billings <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/8/e003352.full" target="_blank">Choosing a model to predict hospital admission: an observational study of new variants of predictive models for case finding</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"e2ca4beb-5df1-5624-b4d5-ea2055a13c56"}}}});
